pragma solidity ^0.5.8;

contract SlavaUkrainToken {
    string public name = "SlavaUkrain";  // Nome do Token
    string public symbol = "SUT";        // Símbolo do Token
    uint8 public decimals = 18;          // Decimais
    uint256 public totalSupply;          // Suprimento total de tokens

    mapping(address => uint256) public balanceOf; // Mapeamento de saldos
    mapping(address => mapping(address => uint256)) public allowance; // Mapeamento de aprovações

    // Eventos
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);

    // Construtor do contrato
    constructor() public {
        totalSupply = 1_000_000_000 * 10 ** uint256(decimals); // 1 bilhão de tokens
        balanceOf[msg.sender] = totalSupply; // Envia todo o supply para o criador
        emit Transfer(address(0), msg.sender, totalSupply); // Emite evento de transferência
    }

    // Função para transferir tokens
    function transfer(address recipient, uint256 amount) public returns (bool) {
        require(balanceOf[msg.sender] >= amount, "Saldo insuficiente");
        require(recipient != address(0), "Endereço inválido");
        balanceOf[msg.sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    // Função para aprovar gastos de terceiros
    function approve(address spender, uint256 amount) public returns (bool) {
        allowance[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    // Função para transferir tokens de uma conta para outra
    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        require(balanceOf[sender] >= amount, "Saldo insuficiente");
        require(allowance[sender][msg.sender] >= amount, "Permissão insuficiente");
        balanceOf[sender] -= amount;
        balanceOf[recipient] += amount;
        allowance[sender][msg.sender] -= amount;
        emit Transfer(sender, recipient, amount);
        return true;
    }

    // Função para "queimar" tokens (reduzir o suprimento total)
    function burn(uint256 amount) public returns (bool) {
        require(balanceOf[msg.sender] >= amount, "Saldo insuficiente para queimar");
        totalSupply -= amount;
        balanceOf[msg.sender] -= amount;
        emit Transfer(msg.sender, address(0), amount); // Emite evento de queima
        return true;
    }

    // Funções de leitura (sem custos de gás)
    function getName() public view returns (string memory) {
        return name;
    }

    function getSymbol() public view returns (string memory) {
        return symbol;
    }

    function getTotalSupply() public view returns (uint256) {
        return totalSupply;
    }
}
